import "./coffeList.scss";
import Coffe1 from "../img/coffe-1.png";


const CoffeList = ({clickEvent}) =>{


    return(


       <ul className="coffe-list">

            <li><figure onClick={(e)=>{console.log(1); clickEvent(0);}}><img src={Coffe1}/></figure></li>
            <li><figure onClick={(e)=>{console.log(1); clickEvent(1);}}><img src={Coffe1}/></figure></li>
            <li><figure onClick={(e)=>{console.log(1); clickEvent(2);}}><img src={Coffe1}/></figure></li>

       </ul>


    )

}

export default CoffeList;
